import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
  },
  heading: {
    color: 'rgba(0,183,255, 1)',
  },
  image: {
    marginLeft: '15px',
  },
  form: {
    margin: 20,
    // marginLeft: 20,
    // marginRight: 20,
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-evenly',
  },
  paper: {
    height: 450,
    display: 'flex',
    flexDirection: 'column',
  }
}));
